// components/FarmerLanding.js
import React from 'react';
import './FarmerLanding.css';
import backgroundImage from '../assets/farmer-bg.png'; // Use your background image
import logo from '../assets/logo.png'; // Path to logo image

function FarmerLanding() {
  return (
    <div className="farmer-landing" style={{ backgroundImage: `url(${backgroundImage})` }}>
      <nav className="navbar">
        <div className="logo-container">
          <img src={logo} alt="Logo" className="logo" />
          <a href="/" className="navbar-link">Home</a>
        </div>
        <div className="language-selector">
          <button>English</button>
          <button>Hindi</button>
        </div>
      </nav>
      <h1 className="landing-heading">FarmEazyy <span>farmers.com</span></h1>
    </div>
  );
}

export default FarmerLanding;
